import React from "react";
import styles from "./Testimonials.module.scss";

const Testimonials = () => {
  return (
    <section className={styles.testimonials}>
      <div className="container">
        <div className={styles.box}>Testimonials</div>
      </div>
    </section>
  );
};

export default Testimonials;
